import data from './user.json';
export const App = () => {
  console.log(data);
  return (
    <div
      style={{
        height: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        fontSize: 40,
        color: '#010101',
      }}
    >
      {JSON.stringify(data, 2, null)}
    </div>
  );
};
